import React from 'react'


export const Card = ({num, title, para, img}) => {
  return (
    <div className='flex flex-row w-[200px]'>
      <img src={img} alt="" />
      <div className='flex flex-col'>
        <h1 className='font-Inter'>{num}</h1>
        <h2 className='font-Inter'>{title}</h2>
        <p>{para}</p>
      </div>
    </div>
  )
}
